import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div className="container mt-5">
      <h2>Welcome to Your Dashboard</h2>
      <p>You can request help if your vehicle breaks down.</p>
      <Link to="/request-help" className="btn btn-primary m-2">Request Help</Link>
      <Link to="/" className="btn btn-secondary m-2">Logout</Link>
    </div>
  );
};

export default Dashboard;
